import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Classes from './Classes';
import SignUp from './SignUp'
import SignIn from './SignIn'
import Dashboard from './Dashboard'
import AddClassBox from './AddClassBox'
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<><App /></>}/>
        <Route path="/classes-overview" element={<><Classes /><AddClassBox /></>}/>
        <Route path="/signup" element={<><App /><SignUp /></>}/>
        <Route path="/signin" element={<><App /><SignIn /></>}/>
        <Route path="/class-1/home/student" element={<><Dashboard /></>}/>
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
